import React, { useState, useEffect } from "react";
import { Routes, Route, Link } from "react-router-dom";
import { motion } from "framer-motion";

import Home from "./pages/Home";
import DigitalLandscapes from "./pages/DigitalLandscapes";
import PlaylistLocalization from "./pages/PlaylistLocalization";
import WebVerifyExpansion from "./pages/WebVerifyExpansion";
import UnifiedAuth from "./pages/UnifiedAuth";
import WaveBackground from "./components/WaveBackground";

export default function App() {
  const [darkMode, setDarkMode] = useState(() => {
    return localStorage.getItem("theme") === "dark";
  });

  useEffect(() => {
    localStorage.setItem("theme", darkMode ? "dark" : "light");
  }, [darkMode]);

  return (
    <div
      className={`min-h-screen ${
        darkMode ? "bg-black text-white" : "bg-white text-black"
      }`}
    >
      <WaveBackground darkMode={darkMode} />

      {/* Fixed header */}
      <header className="fixed top-0 right-0 p-8 z-20">
        <button
          onClick={() => setDarkMode(!darkMode)}
          className="w-12 h-12 rounded-full border border-current flex items-center justify-center hover:bg-current hover:text-white transition-all duration-300"
        >
          {darkMode ? "☀️" : "🌙"}
        </button>
      </header>

      {/* Hero section */}
      <section className="h-screen flex items-center justify-center px-8">
        <div className="text-center max-w-4xl">
          <motion.h1
            initial={{ opacity: 0, y: 30 }}
            animate={{ opacity: 1, y: 0 }}
            transition={{ duration: 0.8, ease: "easeOut" }}
            className="text-6xl md:text-8xl font-light mb-8 tracking-tight"
          >
            Yaz Liu
          </motion.h1>
          <motion.p
            initial={{ opacity: 0, y: 30 }}
            animate={{ opacity: 1, y: 0 }}
            transition={{ duration: 0.8, delay: 0.2, ease: "easeOut" }}
            className="text-xl md:text-2xl font-light opacity-70 max-w-2xl mx-auto leading-relaxed"
          >
            Product designer focused on turning complexity into clarity
          </motion.p>
        </div>
      </section>

      {/* Work section */}
      <section className="min-h-screen px-8 py-20">
        <div className="max-w-6xl mx-auto">
          <motion.h2
            initial={{ opacity: 0 }}
            whileInView={{ opacity: 1 }}
            transition={{ duration: 0.6 }}
            className="text-4xl font-light mb-20 text-center"
          >
            Selected Work
          </motion.h2>

          <div className="space-y-32">
            {[
              {
                title: "Digital Landscapes",
                subtitle: "Design system and user experience",
                year: "2024",
              },
              {
                title: "Playlist Localization",
                subtitle: "International user experience",
                year: "2023",
              },
              {
                title: "WebVerify i18n Expansion",
                subtitle: "CLEAR",
                year: "2021",
              },
              {
                title: "Unified Auth",
                subtitle: "Authentication system design",
                year: "2022",
              },
            ].map((project, index) => (
              <motion.div
                key={project.title}
                initial={{ opacity: 0, y: 50 }}
                whileInView={{ opacity: 1, y: 0 }}
                transition={{ duration: 0.8, delay: index * 0.1 }}
                whileHover={{ y: -10 }}
                className="group cursor-pointer"
              >
                <Link
                  to={`/case-studies/${project.title
                    .toLowerCase()
                    .replace(/\s+/g, "-")}`}
                >
                  <div className="border-b border-current border-opacity-20 pb-8 group-hover:border-opacity-60 transition-all duration-500">
                    <div className="flex justify-between items-end mb-4">
                      <h3 className="text-3xl md:text-4xl font-light group-hover:opacity-70 transition-opacity duration-300">
                        {project.title}
                      </h3>
                      <span className="text-lg opacity-50">{project.year}</span>
                    </div>
                    <p className="text-lg opacity-60 group-hover:opacity-80 transition-opacity duration-300">
                      {project.subtitle}
                    </p>
                  </div>
                </Link>
              </motion.div>
            ))}
          </div>
        </div>
      </section>

      <Routes>
        <Route path="/" element={<div />} />
        <Route
          path="/case-studies/digital-landscapes"
          element={<DigitalLandscapes />}
        />
        <Route
          path="/case-studies/playlist-localization"
          element={<PlaylistLocalization />}
        />
        <Route
          path="/case-studies/webverify-expansion"
          element={<WebVerifyExpansion />}
        />
        <Route path="/case-studies/unified-auth" element={<UnifiedAuth />} />
      </Routes>
    </div>
  );
}
